-- Now do an in-place, on-site correction for customer data, where possible
DECLARE @docs TABLE (DocumentVersionKey uniqueidentifier, CreatedOn datetime, CreatedByUserKey uniqueidentifier)
-- Get a list of all documents with multiple versions, and the original Creation date
INSERT INTO @docs
    SELECT [DocumentVersionKey], MIN([CreatedOn]), NULL
      FROM [dbo].[DocumentMain]
     GROUP BY [DocumentVersionKey]
    HAVING COUNT([DocumentVersionKey]) > 1
-- Grab the user that crated the original version of the document
UPDATE d
   SET d.[CreatedByUserKey] = dm.[CreatedByUserKey]    
  FROM @docs d INNER JOIN [dbo].[DocumentMain] dm ON d.DocumentVersionKey = dm.DocumentVersionKey
 WHERE d.CreatedOn = dm.CreatedOn
-- Delete from list all documents that are already correct
DELETE d FROM @docs d WHERE NOT EXISTS (SELECT 1 FROM [dbo].[DocumentMain] dm WHERE dm.DocumentVersionKey = d.DocumentVersionKey AND dm.CreatedOn <> d.CreatedOn)
-- Fix up all CreatedOn/By columns to match the original creation date and user
UPDATE dm
   SET dm.[CreatedOn] = d.[CreatedOn], 
       dm.[CreatedByUserKey] = d.[CreatedByUserKey]
  FROM [dbo].[DocumentMain] dm INNER JOIN @docs d ON dm.[DocumentVersionKey] = d.[DocumentVersionKey]
 WHERE dm.[CreatedOn] <> d.[CreatedOn] OR dm.[CreatedByUserKey] <> d.[CreatedByUserKey]
GO
